import logo from './logo.svg';
import './App.css';
import React, { useState } from 'react';
import ButtonComponent from './components/ButtonComponent';

function clicked(name){
  alert(`button clicked by ${name}`);
}
function App() {
  let title = 'Welcome Guest';
  const [label, setLabel] = useState('Register')

  const change=()=>{
    alert('hello');
    //title='hey';
    setLabel('Clear');
    // console.log(title);
  };

  let customers;

  return (
    <React.Fragment>
    <h1>{title}</h1>
    <p>akfhad</p>
    <ButtonComponent label={'Submit'}/>
    <ButtonComponent label={label} change={change}/>
    {/* <button onClick={()=>clicked('Shalini')}>Click Me</button> */}
    <div>
    <p>Customers: {customers && JSON.stringify(customers)}</p>
    </div>
    Customers: {customers.length===0 ? <p>No customers yet!!</p>: JSON.stringify(customers)}

    <div>
      {
        customers.map(cust => <div> {cust.id} : {cust.name}</div>)
      }
    </div>

    <div>
      {
        customers.map(cust => <div> 
            <p>Id: {cust.id}</p>  
            <p>Name : {cust.name}</p>
          </div>)
      }
    </div>
    </React.Fragment>
      );
}

export default App;
